package javaoops;

public class ConstructorProgram {
	int a;
	float b;
	boolean c;
	byte d;
	long e;
	char f;
	double g;
	short h;
	
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		ConstructorProgram obj1=new ConstructorProgram();
		
		System.out.println("a= "+obj1.a);
		System.out.println("b= "+obj1.b);
		System.out.println("c= "+obj1.c);
		System.out.println("d= "+obj1.d);
		System.out.println("e= "+obj1.e);
		System.out.println("f= "+obj1.f);
		System.out.println("g= "+obj1.g);
		System.out.println("h= "+obj1.h);

	}

}
